import { Header } from "./components/header/Header"


function App() {
  return (
    <div className="App">
      <Header />
        <p>How you doing</p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
    </div>
  );
}

export default App;
